import React from "react";
import Footer from "../components/Footer";
import Header from "../components/Header";
import Login from "../components/Login";
import "../styles/default.css";

const Home = () => {
    return(
        <div className="Home">
            <Header/>
            <Login/>
            <Footer/>
        </div>
    );
}

export default Home;
